window.$docsify = {
  // name: 'Keeb.pro',
  // nameLink: '/',
  // // logo: 'docsify/logo.png',
  loadSidebar: true,
  subMaxLevel: 2,
  coverpage: false,
  loadNavbar: false,
  mergeNavbar: true,
  homepage: 'home.md',
  auto2top: true,
  notFoundPage: '404.md',
  formatUpdated: '{YYYY}.{MM}.{DD}',
  plugins: [
    function(hook) {
      var header = [
        // '<header style="text-align: center;margin-top: 50px;">',
        // '<span>Keep it Simple, Stupid</span>',
        // '</header>'
      ].join('');
      var footer = [
        '<footer style="text-align: center;margin-top: 50px;">',
        '<span> Keeb.pro  &copy; 2022 </span>',
        '</footer>'
      ].join('');

      hook.afterEach(function(html) {
        return header+html + footer;
      });
    }
  ],
  darklightTheme: {
    siteFont : 'PT Sans',
    defaultTheme : 'dark | light',
    codeFontFamily : ' courier, monospace',
    bodyFontSize : '15px',
    dark: {
      accent: '#DD4C4F',
      background: '#282C34',
      codeTextColor : '#b4b4b4',
      codeBackgroundColor : '#353A44', 
      coverBackground : '#161B22'
    },
    light: {
      accent: '#DD4C4F',
      coverBackground : '#f0f0f0'
    }
  }
}
window.$docsify.plugins = [].concat((e, o) => {
  let t = {
    siteFont: "PT Sans",
    defaultTheme: "light",
    codeFontFamily: "courier, monospace",
    bodyFontSize: "17px",
    dark: {
      accent: "#42b983",
      toogleBackground: "#ffffff",
      background: "#091a28",
      sidebarBackground:"#222222",
      textColor: "#b4b4b4",
      codeTextColor: "#ffffff",
      codeBackgroundColor: "#0e2233",
      borderColor: "#0d2538",
      LogoBorderColor: "#aaa",
      blockQuoteColor: "#858585",
      highlightColor: "#d22778",
      sidebarSublink: "#b4b4b4",
      codeTypeColor: "#ffffff",
      coverBackground:
        "linear-gradient(to left bottom, hsl(118, 100%, 85%) 0%,hsl(181, 100%, 85%) 100%)",
      toogleImage:
        "url(./icons/sun.svg)",
    },
    light: {
      accent: "#42b983",
      toogleBackground: "#091a28",
      background: "#f7f7f7",
      sidebarBackground:"#efefef",
      textColor: "#34495e",
      codeTextColor: "#525252",
      codeBackgroundColor: "#f8f8f8",
      borderColor: "#aaa",
      LogoBorderColor: "#ccc",
      blockQuoteColor: "#858585",
      highlightColor: "#d22778",
      sidebarSublink: "#505d6b",
      codeTypeColor: "#091a28",
      coverBackground:
        "linear-gradient(to left bottom, hsl(118, 100%, 85%) 0%,hsl(181, 100%, 85%) 100%)",
      toogleImage:
        "url(./icons/moon.svg)",
    },
  };
  if (o.config.hasOwnProperty("darklightTheme")) {
    for (var [r, l] of Object.entries(o.config.darklightTheme))
      "light" !== r && "dark" !== r && "defaultTheme" !== r && (t[r] = l);
    for (var [r, l] of Object.entries(t))
      "light" !== r &&
        "dark" !== r &&
        ((t[r] = l), document.documentElement.style.setProperty("--" + r, l));
    if (o.config.darklightTheme.hasOwnProperty("dark"))
      for (var [r, l] of Object.entries(o.config.darklightTheme.dark))
        t.dark[r] = l;
    if (o.config.darklightTheme.hasOwnProperty("light"))
      for (var [r, l] of Object.entries(o.config.darklightTheme.light))
        t.light[r] = l;
  } else
    for (var [r, l] of Object.entries(t))
      "light" !== r &&
        "dark" !== r &&
        ((t[r] = l), document.documentElement.style.setProperty("--" + r, l));
  window.matchMedia("(prefers-color-scheme: dark)").matches
    ? (t.defaultTheme = "dark")
    : window.matchMedia("(prefers-color-scheme: light)").matches &&
      (t.defaultTheme = "light");
  var d = (e) => {
    if (
      (localStorage.setItem("DARK_LIGHT_THEME", e),
      (t.defaultTheme = e),
      "light" == e)
    )
      for (var [o, r] of Object.entries(t.light))
        document.documentElement.style.setProperty("--" + o, r);
    else if ("dark" == e)
      for (var [o, r] of Object.entries(t.dark))
        document.documentElement.style.setProperty("--" + o, r);
    document.documentElement.style.setProperty("color-scheme", e);
  };
  e.afterEach(function (e, o) {
    o((e = '<div id="docsify-darklight-theme"><p>.</p></div>' + e));
  }),
    e.doneEach(function () {
      let e = localStorage.getItem("DARK_LIGHT_THEME");
      "light" == e || "dark" == e
        ? ((t.defaultTheme = e), d(t.defaultTheme))
        : d(t.defaultTheme);
      const o = document.getElementById("docsify-darklight-theme");
      null !== o &&
        o.addEventListener("click", function () {
          "light" === t.defaultTheme ? d("dark") : d("light");
        });
    });
}, window.$docsify.plugins);
